import React from 'react';
import '../styles/MapView.css';

function MapView({ trafficData }) {
    return (
        <div className="map-view">
            <h2>Traffic Map</h2>
            {/* Placeholder for a map */}
            <div className="map-placeholder">
                <p>Map visualization of traffic data goes here.</p>
                {trafficData.map((data, index) => (
                    <div key={index}>
                        Location: {data.location}, Congestion Level: {data.congestionLevel}
                    </div>
                ))}
            </div>
        </div>
    );
}

export default MapView;
